import React from 'react'
import imgs from "./app.json"

export default function Videos() {
    return (
        <video className="w-100" autoPlay loop muted>
            <source
                src={img.urlVideo}
                type="video/mp4"
                allowFullScreen
            />
        </video>
    )
}
